#include "ntlib.h"

u64 gcd(u64 a, u64 b) {
    while(1) {
        if(b == 0) return a;
        a %= b;
        if(a == 0) return b;
        b %= a;
    }
}

i64 diophantine(i64 a, i64 b, i64* x, i64* y) {
    i64 ap = 1, aq = 0;
    i64 bp = 0, bq = 1;
    while(1) {
        if(b == 0) {
            *x = ap;
            *y = aq;
            return a;
        }
        i64 m = a / b;
        a %= b;
        ap -= bp * m;
        aq -= bq * m;
        if(a == 0) {
            *x = bp;
            *y = bq;
            return b;
        }
        i64 n = b / a;
        b %= a;
        bp -= ap * n;
        bq -= aq * n;
    }
}

u64 reverse(u64 a, u64 M) {
    u64 x = 1, y = 0;
    while(1) {
        if(a == 0) return y;
        u64 k = a / M;
        a %= M;
        x -= y * k;
        if(M == 0) return x;
        u64 l = M / a;
        M %= a;
        y -= x * l;
    }
}

u32 pow32(u32 a, u64 k, u32 M) {
    u32 ans = 1;
    while(k) {
        if(k % 2) ans =  (u64)ans * a % M;
        a = (u64)a * a % M;
        k /= 2;
    }
    return ans;
}

inline u32 pow(u32 a, u64 k, u32 M) { return pow32(a, k, M); };

u64 __modmul(u64 a, u64 b, u64 M) {
    return (unsigned __int128) a * b % M;
}

//__modmul1 by kactl, adapted
//note: M can be max 7'268'999'999'999'999'999
//note: 0 <= a, b < M shall hold
inline u64 __modmul1(u64 a, u64 b, u64 M) {
	i64 ret = a * b - M * u64(1.L / M * a * b);
	return ret + M * (ret < 0) - M * (ret >= (i64)M);
}

u64 pow64(u64 a, u64 k, u64 M) {
    u64 ans = 1;
    while(k) {
        if(k % 2) ans = __modmul1(ans, a, M);
        a = __modmul1(a, a, M);
        k /= 2;
    }
    return ans;
}

i32 miller_rabin_single(u64 x, u64 a) {
    //x - 1 = 2^k * d
    u64 d = x - 1;
    u64 k = 0;
    while(d % 2 == 0) d /= 2, ++k;
    u64 u = pow64(a, d, x);
    
    if(u == 1) return 1;
    while(k--) {
        if(u + 1 == x) return 1;
        u = __modmul(u, u, x);
    }
    return 0;
}

i32 is_prime(u64 x) {
    //note: x can be max 7'267'999'999'999'999'999
    if(x < 2) return 0;
    if(x != 2 && !miller_rabin_single(x, 2)) return 0;
    if(x != 3 && !miller_rabin_single(x, 3)) return 0;
    if(x != 5 && !miller_rabin_single(x, 5)) return 0;
    if(x != 7 && !miller_rabin_single(x, 7)) return 0;
    if(x != 11 && !miller_rabin_single(x, 11)) return 0;
    if(x < 2'152'302'898'747ULL) return 1;
    if(x != 13 && !miller_rabin_single(x, 13)) return 0;
    if(x != 17 && !miller_rabin_single(x, 17)) return 0;
    if(x != 19 && !miller_rabin_single(x, 19)) return 0;
    if(x != 23 && !miller_rabin_single(x, 23)) return 0;
    if(x < 3'825'123'056'546'413'051ULL) return 1;
    if(x != 29 && !miller_rabin_single(x, 29)) return 0;
    if(x != 31 && !miller_rabin_single(x, 31)) return 0;
    if(x != 37 && !miller_rabin_single(x, 37)) return 0;
    return 1;
}

//modmul by kactl, adapted
//note: M can be max 7'268'999'999'999'999'999
//note: 0 <= a, b < M shall hold
inline u64 __modmul2(u64 a, u64 b, u64 M, f80 r) {
	i64 ret = a * b - M * u64(r * a * b);
	return ret + M * (ret < 0) - M * (ret >= (i64)M);
}

i32 miller_rabin_single1r(u64 x, u64 a, f80 r) {
    u64 y = x - 1, aa = a;
    u64 u = 1; u32 k = 0;
    while(y) {
        if(y % 2) u = __modmul2(u, aa, x, r);
        if(u > 1) aa = __modmul2(aa, aa, x, r);
        else ++k;
        y /= 2;
    }

    if(u == 1) return 1;
    while(k--) {
        if(u + 1 == x) return 1;
        u = __modmul2(u, u, x, r);
    }
    return 0;
}

i32 is_prime1r(u64 x) {
    //note: x can be max 7'267'999'999'999'999'999
    if(x < 2) return 0;
    f80 r = 1.L / x;
    if(x != 2 && !miller_rabin_single1r(x, 2, r)) return 0;
    if(x != 3 && !miller_rabin_single1r(x, 3, r)) return 0;
    if(x != 5 && !miller_rabin_single1r(x, 5, r)) return 0;
    if(x != 7 && !miller_rabin_single1r(x, 7, r)) return 0;
    if(x != 11 && !miller_rabin_single1r(x, 11, r)) return 0;
    if(x < 2'152'302'898'747ULL) return 1;
    if(x != 13 && !miller_rabin_single1r(x, 13, r)) return 0;
    if(x != 17 && !miller_rabin_single1r(x, 17, r)) return 0;
    if(x != 19 && !miller_rabin_single1r(x, 19, r)) return 0;
    if(x != 23 && !miller_rabin_single1r(x, 23, r)) return 0;
    if(x < 3'825'123'056'546'413'051ULL) return 1;
    if(x != 29 && !miller_rabin_single1r(x, 29, r)) return 0;
    if(x != 31 && !miller_rabin_single1r(x, 31, r)) return 0;
    if(x != 37 && !miller_rabin_single1r(x, 37, r)) return 0;
    return 1;
}

u64 fib(u64 k, u64 M) {    
    u64 ans[2][2] = {{1, 0}, {0, 1}};
    u64 mat[2][2] = {{1, 1}, {1, 0}};
    while(k) {
        if(k % 2) {
            mul_matrix2d(ans, mat);
            mod_matrix2d(ans, M);
        }
        mul_matrix2d(mat, mat);
        mod_matrix2d(mat, M);
        k /= 2;
    }
    return ans[1][0];
}

inline void __fib_combine(u64 f[3], const u64 g[3], u64 M) {
    u64 sth[3];
    sth[0] = f[0] * g[0];
    sth[1] = f[1] * g[1];
    sth[2] = f[2] * g[2];
    f[0] = (sth[0] + sth[1])         % M;
    f[1] = (sth[2] - sth[0] + M * M) % M;
    f[2] = (sth[1] + sth[2])         % M;
}

u64 fib1(u64 k, u64 M) {
    // note: M can be max 3 037 000 500
    u64 ans[3] = {1, 0, 1};
    u64 xyz[3] = {0, 1, 1};
    while(k) {
        if(k % 2) __fib_combine(ans, xyz, M);
        __fib_combine(xyz, xyz, M);
        k /= 2;
    }
    return ans[1];
}

