u64 sqrt(u64 n) {
    u64 p = 0, q = u32_max;
    while(q - p > 1) {
        u64 mid = (p + q) / 2;
        if(mid * mid > n) q = mid;
        else p = mid;
    }
    return p;
}

inline void mov_matrix2d(u64 A[2][2], u64 B[2][2]) {
    A[0][0] = B[0][0];
    A[0][1] = B[0][1];
    A[1][0] = B[1][0];
    A[1][1] = B[1][1];
}

inline void add_matrix2d(u64 A[2][2], u64 B[2][2]) {
    A[0][0] += B[0][0];
    A[0][1] += B[0][1];
    A[1][0] += B[1][0];
    A[1][1] += B[1][1];
}

inline void mul_matrix2d(u64 A[2][2], u64 B[2][2]) {
    u64 Z[2][2];
    Z[0][0] = A[0][0] * B[0][0] + A[0][1] * B[1][0];
    Z[0][1] = A[0][0] * B[0][1] + A[0][1] * B[1][1];
    Z[1][0] = A[1][0] * B[0][0] + A[1][1] * B[1][0];
    Z[1][1] = A[1][0] * B[0][1] + A[1][1] * B[1][1];
    mov_matrix2d(A, Z);
}

inline void mod_matrix2d(u64 A[2][2], u64 M) {
    A[0][0] %= M;
    A[0][1] %= M;
    A[1][0] %= M;
    A[1][1] %= M;
}

u8 fact(u64 n, u64* primes, u8* exps) {
    u8 top = 0;
    for(u64 d = 2; d * d <= n; ++d) {
        if(n % d) continue;
        primes[top] = d;
        exps[top] = 0;
        while(n % d == 0) {
            ++exps[top];
            n /= d;
        }
        ++top;
    }
    if(n > 1) {
        primes[top] = n;
        exps[top] = 1;
        ++top;
    }
    return top;
}

void primality(u32 n, u8* array) {
    array[0] = 0;
    array[1] = 0;
    for(u32 i = 2; i < n; ++i) array[i] = 1;
    for(u32 i = 2; i * i <= n; ++i) {
        if(!array[i]) continue;
        for(u32 j = 2 * i; j < n; j += i) array[j] = 0;
    }
}

u64 seeder(u64 nmb) {
    static u64 seed = 1049204920;
    if(nmb) seed = nmb;
    return seed;
}

u32 rand32() {
    static const u64 a = 12093869;
    static const u64 c = 313;
    u64 seed = seeder(0);
    seed *= a;
    seed += c;
    seeder(seed);
    return seed >> 19 ^ seed >> 7;
}

u64 rand64() {
    u64 a = rand32();
    u64 b = rand32();
    return b << 55 ^ a << 23 ^ b >> 9;
}